import React from "react";
import "../navbarWithToggle/NavbarToggle.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import togglerIcon from "../images/togglerIcon.svg";
import { HashLink as Link } from "react-router-hash-link";
//import Scrollspy from "react-scrollspy";
// import Scrollspy from "react-scrollspy";

const NavbarToggle = () => {
  return (
    <div className="navbar">
      <div className="mobileNav d-md-flex justify-content-center">
        {/* <Scrollspy
          scrollTargetIds={[
            "services",
            "projects",
            "timeline",
            "team",
            "contact",
          ]}
        > */}
        <input className="menu-btn" type="checkbox" id="menu-btn"></input>
        <label className="menu-icon" htmlFor="menu-btn">
          <span className="navicon"></span>
        </label>
        <ul className="menu">
          <li className="menu-link">
            <Link smoth to="#service">
              <a href="#service">SERVICES</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link to="/projects">
              <a href="#projects">PROJECTS</a>
            </Link>
          </li>
          <li className="menu-link">
            <a href="/timeline">TIMELINE</a>
          </li>
          <li className="menu-link">
            <a href="/team">TEAM</a>
          </li>
          <li className="menu-link">
            <a href="/contact">CONTACT</a>
          </li>
        </ul>
        {/* </Scrollspy> */}
      </div>
    </div>
  );
};

export default NavbarToggle;
